  CREATE INDEX "SI_GEN_DICCIONARIO_IDPROPIEDAD" ON "GEN_DICCIONARIO" ("IDPROPIEDAD") ;
  ALTER TABLE "GEN_DICCIONARIO" MODIFY ("IDLENGUAJE" NOT NULL ENABLE);
  ALTER TABLE "GEN_DICCIONARIO" MODIFY ("ERROR" NOT NULL ENABLE);
  ALTER TABLE "GEN_DICCIONARIO" MODIFY ("DESCRIPCION" NOT NULL ENABLE);
  ALTER TABLE "GEN_DICCIONARIO" MODIFY ("IDRECURSO" NOT NULL ENABLE);
  ALTER TABLE "GEN_DICCIONARIO" MODIFY ("USUMODIFICACION" NOT NULL ENABLE);
  ALTER TABLE "GEN_DICCIONARIO" MODIFY ("FECHAMODIFICACION" NOT NULL ENABLE);
  ALTER TABLE "GEN_DICCIONARIO" ADD CONSTRAINT "PK_GEN_DICCIONARIO" PRIMARY KEY ("IDRECURSO", "IDLENGUAJE") DEFERRABLE;
  
  
    COMMIT;
    
    
